import { TabBar } from 'antd-mobile';
import React,{Component}from 'react'
import Home from '@/components/main/Home'
import My from '@/components/main/My'
import Task from '@/components/main/Task'
import {Icon}from 'antd-mobile'
import {HomeOutlined,UserOutlined,CopyOutlined } from '@ant-design/icons'

class Cmp1 extends Component{
  constructor(...args) {
    super(...args);
    this.state = {
      selectedTab: 'blueTab',
      hidden: false
    };
  }
  render(){
    return (
      <div style={{position: 'fixed', height: '100%', width: '100%', top: 0,paddingTop:'45px',boxSizing:"border-box"}}>
        <TabBar
          unselectedTintColor="#949494"
          tintColor="#77CC99"
          barTintColor="white"
          hidden={this.state.hidden}
        >
          <TabBar.Item
            title="主页"
            key="主页"
            icon={<HomeOutlined className="mainIcon"/>}
            selectedIcon={<HomeOutlined className="mainIcon"/>}
            selected={this.state.selectedTab === 'blueTab'}
            onPress={() => {
              this.setState({
                selectedTab: 'blueTab',
              });
            }}
            data-seed="logId"
          >
           <Home/>
          </TabBar.Item>
          <TabBar.Item
            icon={<CopyOutlined className="mainIcon"/>
            }
            selectedIcon={<CopyOutlined className="mainIcon"/>
            }
            title="任务"
            key="任务"

            selected={this.state.selectedTab === 'greenTab'}
            onPress={() => {
              this.setState({
                selectedTab: 'greenTab',
              });
            }}
          >
            <Task/>
          </TabBar.Item>
          <TabBar.Item
            icon={<UserOutlined className="mainIcon"/>}
            selectedIcon={<UserOutlined className="mainIcon"/>}
            title="我的"
            key="我的"
            selected={this.state.selectedTab === 'yellowTab'}
            onPress={() => {
              this.setState({
                selectedTab: 'yellowTab',
              });
            }}
          >
            <My/>
          </TabBar.Item>
        </TabBar>
      </div>
    )
  }
};

export default Cmp1;
